import React from 'react';
import PropTypes from 'prop-types';
import classes from './Book.module.css';

const book = ({ bookItem: { id, title, category }, clicked }) => (
  <div className={classes.Book}>
    <div className={classes.LeftSection}>
      <div className={classes.Category}>{category}</div>
      <h3 className={classes.Title}>{title}</h3>
      <div className={classes.Writer}>Writer Name</div>
      <div className={classes.Btns}>
        <button type="button" id={id} onClick={clicked} className={[classes.btn, classes.delete]}>Remove</button>
        <button type="button" className={[classes.btn, classes.show]}>Show</button>
        <button type="button" className={[classes.btn, classes.edit]}>Edit</button>
      </div>
    </div>
  </div>
);

book.propTypes = {
  bookItem: PropTypes.instanceOf(Object).isRequired,
  clicked: PropTypes.func.isRequired,
};
export default book;
